import React from 'react';
import { NavLink } from 'react-router-dom';
import './TopMenu.css';

const TopMenu = () => {
    return (
        <nav className="top-menu">
            <NavLink exact to="/" className="menu-item" activeClassName="active">Home</NavLink>
            <NavLink to="/pick-dish" className="menu-item" activeClassName="active">Pick Dish</NavLink>
            <NavLink to="/contact" className="menu-item" activeClassName="active">Contact</NavLink>
        </nav>
    );
};

export default TopMenu;
